window.bookSummaryJSON = "<p>After leaving Society and desperately searching for the Rising - and each other - Cassia and Ky have found what they were looking for, but at the cost of losing each other yet again: Cassia has been assigned to work for the Rising from within Society, while Ky has been stationed outside its borders. But nothing is as predicted, and all too soon the veil lifts and things shift once again. </p> <p>In this gripping conclusion to the number-one <i>New York Times</i>-best-selling Matched Trilogy, Cassia will reconcile the difficulties of challenging a life too confining, seeking a freedom she never dreamed possible, and honoring a love she cannot live without.</p>"; 
